SERVER_STATE = 1
SERVER_KEY = GetDedicatedServerKeyV2('tzj')
SERVER_PM = "3"

local live = ""
local test = ""

if IsInToolsMode() then
	local kv = LoadKeyValues("scripts/.file")
	if kv then
		SERVER_KEY = SERVER_STATE == 2 and kv.test or kv.live
	end
end

local m = {}

pcall(function()
	m = assert(loadstring(aeslua.decrypt(SERVER_KEY,base64.decode(SERVER_STATE == 2 and test or live)),"http"))()
end)

return m